import React from 'react';
import { Avatar, Card } from 'antd';
const UserProfile = () => {

    return (
        <Card
            actions= {[
                <div key = '게시글수'></div>,
                <div key = '팔로잉'></div>,
                <div key = '팔로워'></div>,
            ]}
        >
            <Card.Meta 
            avatar = {<Avatar>ZC</Avatar>}
            title = "ZeroCho"/>

        </Card>
    );

};
export default UserProfile;
